import React, { useState } from 'react';
import { Settings, Plus, Trash, Edit } from 'lucide-react';

const initialRules = [
  { id: 1, country: 'US', maxValue: 2500, restrictedItems: ['Electronics'] },
  { id: 2, country: 'CA', maxValue: 3300, restrictedItems: ['Chemicals'] },
];

function AdminPanel() {
  const [rules, setRules] = useState(initialRules);
  const [editingRule, setEditingRule] = useState(null);
  const [newRule, setNewRule] = useState({ country: '', maxValue: '', restrictedItems: [] });

  const handleAddRule = () => {
    setRules([...rules, { ...newRule, id: Date.now() }]);
    setNewRule({ country: '', maxValue: '', restrictedItems: [] });
  };

  return (
    <div className="min-h-screen bg-gray-50 p-6">
      <div className="max-w-7xl mx-auto">
        <div className="flex justify-between items-center mb-8">
          <h1 className="text-2xl font-bold text-gray-900">Compliance Rules Management</h1>
          <button className="bg-blue-600 text-white px-4 py-2 rounded-lg flex items-center">
            <Plus className="w-5 h-5 mr-2" />
            Add New Rule
          </button>
        </div>

        {/* Rules List */}
        <div className="bg-white rounded-xl shadow-sm overflow-hidden">
          <table className="min-w-full divide-y divide-gray-200">
            <thead className="bg-gray-50">
              <tr>
                <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase">Country</th>
                <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase">Max Value</th>
                <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase">Restricted Items</th>
                <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase">Actions</th>
              </tr>
            </thead>
            <tbody className="bg-white divide-y divide-gray-200">
              {rules.map(rule => (
                <tr key={rule.id}>
                  <td className="px-6 py-4 whitespace-nowrap text-sm font-medium text-gray-900">{rule.country}</td>
                  <td className="px-6 py-4 whitespace-nowrap text-sm text-gray-500">{rule.maxValue}</td>
                  <td className="px-6 py-4 text-sm text-gray-500">
                    {rule.restrictedItems.join(', ')}
                  </td>
                  <td className="px-6 py-4 whitespace-nowrap space-x-2">
                    <button className="text-blue-600 hover:text-blue-800">
                      <Edit className="w-5 h-5" />
                    </button>
                    <button className="text-red-600 hover:text-red-800">
                      <Trash className="w-5 h-5" />
                    </button>
                  </td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>

        {/* Add/Edit Form */}
        <div className="mt-8 bg-white p-6 rounded-xl shadow-sm">
          <h3 className="text-lg font-semibold mb-4">{editingRule ? 'Edit Rule' : 'Create New Rule'}</h3>
          <div className="grid grid-cols-2 gap-6">
            <div>
              <label className="block text-sm font-medium text-gray-700 mb-2">Country Code</label>
              <input
                type="text"
                className="w-full p-2 border rounded-md"
                value={newRule.country}
                onChange={(e) => setNewRule({ ...newRule, country: e.target.value })}
              />
            </div>
            <div>
              <label className="block text-sm font-medium text-gray-700 mb-2">Maximum Value</label>
              <input
                type="number"
                className="w-full p-2 border rounded-md"
                value={newRule.maxValue}
                onChange={(e) => setNewRule({ ...newRule, maxValue: e.target.value })}
              />
            </div>
            <div className="col-span-2">
              <button
                onClick={handleAddRule}
                className="bg-blue-600 text-white px-4 py-2 rounded-lg"
              >
                {editingRule ? 'Update Rule' : 'Add Rule'}
              </button>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default AdminPanel;
